import React from 'react'
import "../App.css";
import {SidebarData} from './SidebarData'

function Sidebar() {
    return (
        <div className="Sidebar">
            <ul>
            {SidebarData.map((val, key) => {
               return (
                   <li key={key} 
                   onClick={() => {window.location.pathname = val.path}}>
                   
                       <div>
                           {val.icon}
                       </div>

                   </li>
               )
           })}
            </ul>
          
        </div>
    )
}

export default Sidebar
